import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent
{
  public title = "Gestionnaire d'hotels";

  name = "Angular";
  base64 = ``;
  pdfSrc = "";
  printPdf()
  {
    // let json: any =  { "type":"Buffer", "data":this.blob }
    // let bufferOriginal = Buffer.from(json.data);
    const byteArray = new Uint8Array(
      atob(this.base64)
        .split("")
        .map(char => char.charCodeAt(0))
    );
    const file = new Blob([byteArray], { type: "application/pdf" });
    const fileURL = URL.createObjectURL(file);
    this.pdfSrc = fileURL;
    window.open(fileURL);
  }

  downloadPdf()
  {
    const byteArray = new Uint8Array(
      atob(this.base64).split("").map(char => char.charCodeAt(0))
    );
    const file = new Blob([byteArray], { type: "application/pdf" });
    const fileURL = URL.createObjectURL(file);
    let pdfName = "reports.pdf";
    // if (window.navigator && window.navigator.msSaveOrOpenBlob)
    // {
    //   window.navigator.msSaveOrOpenBlob(file, pdfName);
    // } else
    // {
    window.open(fileURL);

    // Construct the 'a' element
    let link = document.createElement("a");
    link.download = pdfName;
    link.target = "_blank";

    // Construct the URI
    link.href = fileURL;
    document.body.appendChild(link);
    link.click();

    // Cleanup the DOM
    document.body.removeChild(link);
    // }
  }
}
